import React from "react";
import action from "./images/action.png";
import Drama from "./images/Drama.png";
import Romance from "./images/Romance.png";
import Thriller from "./images/Thriller.png";
import Western from "./images/Western.png";
import Horror from "./images/Horror.png";
import Fantasy from "./images/Fantasy.png";
import music from "./images/music.png";
import Fiction from "./images/Fiction.png";
import alert from "./images/alert.png";
import "./Onboarding.css";



const Onboarding = () => {
  return (
    <div className="board2">
      <h1 className="heading2">Super App</h1>
      <div className="block1">
        <h2 className="choose" >Choose your Entertainment Category</h2>
      </div>
      <div className="block2">
      <img cla src={action} alt="not found" />
      <img clasrc={Drama} alt="not found" />
      <img clasrc={Romance} alt="" />
      <img clasrc={Thriller} alt="" />
      <img clasrc={Western} alt="" />
      <img clasrc={Horror} alt="" />
      <img clasrc={Fantasy} alt="" />
      <img clasrc={music} alt="" />
      <img clasrc={Fiction} alt="" />
      </div>
       <img className="alert"src={alert} alt="" />
      <p className="Note">Minimum 3 Category Required</p>
      <button className="Next-page">Next Page</button>
      </div>
  );
};

export default Onboarding;
